Explanation:
- I searched the codebase for occurrences of "getMyOrders" and found it referenced in the route file (routes/orderRoutes.js) and implemented in backend/controllers/orderController.js.
- The implementation in backend/controllers/orderController.js (around line 64) is:

  const getMyOrders = asyncHandler(async (req, res) => {
    const orders = await Order.find({ user: req.user._id });
    res.json(orders);
  });

  This handler queries the Order model for orders belonging to the authenticated user (req.user._id) and returns them as JSON.
